column13:
A method for providing access to data items by means of communication device provided with a screen. The method comprises the following steps: 
-- generating one icon for each received data item; 
-- associating the one icon to the respective data item; 
-- displaying the icons on the screen as a function of time when the assigned data item has been received; and 
-- creating a three-dimensional view on the screen by displaying icons on different levels in the three-dimensional view. Furthermore, a device is suggested which comprises processing means provided for executing the method.
